window.bookSummaryJSON = "<p>A collection of original short stories offers an intimate and dark portrait of life in the United States as they journey through California seeking answers to our changing world, dealing with such topics as jealousy, AIDS, sex, and Jim Morrison.</p> <p>A new reissue of Babitzâ€™s collection of nine stories that look back on the 1980s and early 1990s - decades of dreams, drink, and glimpses of a changing world. <i>Black Swans</i> further celebrates the phenomenon of Eve Babitz, cementing her reputation as the voice of a generation.</p>"; 
